    <div class="card">
        <div class="three-dot">
            <svg xmlns="http://www.w3.org/2000/svg" class="icon icon-tabler icon-tabler-dots" width="24" height="24"
                viewBox="0 0 24 24" stroke-width="2" stroke="currentColor" fill="none" stroke-linecap="round"
                stroke-linejoin="round">
                <path stroke="none" d="M0 0h24v24H0z" fill="none"></path>
                <path d="M5 12m-1 0a1 1 0 1 0 2 0a1 1 0 1 0 -2 0"></path>
                <path d="M12 12m-1 0a1 1 0 1 0 2 0a1 1 0 1 0 -2 0"></path>
                <path d="M19 12m-1 0a1 1 0 1 0 2 0a1 1 0 1 0 -2 0"></path>
            </svg>
        </div>
        <div class="user">
            <img class="user-image" src="https://i.postimg.cc/qM4kk25q/new2.png" alt="profile picture">
            <h2 class="user-name">Jay Reese</h2>
        </div>

        <div class="projects-prototype">
            <div class="projects">
                <h2>2</h2>
                <p>Projects</p>
            </div>
            <div class="prototype">
                <h2>6</h2>
                <p>Prototypes</p>
            </div>
        </div>
    </div>
